package org.javaprogramms.basic.Controlstatements;

public class ContinueStatement {
	
	//print numbers in descending order

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=10; i>=1; i--)
		{
			if(i>5)
			System.out.println(i+" ");
		}
		
		
		

	}
	
	

}
